window.initComponents=function(evt){if(evt.detail?.type==="started"){if(window.templUI){Object.values(window.templUI).forEach((comp)=>{comp.cleanup?.(document);});}}
if(evt.detail?.type==="finished"){setTimeout(()=>{if(window.templUI){Object.values(window.templUI).forEach((comp)=>{comp.init?.();});}},100);}};